INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(17, 3, 1, 'liquidificador|Ativado|Nenhum|Liquidificador Easyline BBR20 5 velocidades - Electrolux||5 velocidades + pulsar; Potência 500w; Jarra transparente com capacidade de 1,5l; Lâminas removíveis; Copo dosador; Tampa com fácil encaixe; Trava de segurança; Pés com ventosas; Local para enrolar o cabo elétrico e filtro para separar a semente do suco.|126|1'),
(16, 2, 1, 'microondas|Ativado|Nenhum|Micro-ondas Brastemp Ative! 30 Litros BMS45A Branco|Caracter&iacute;sticas f&iacute;sicas e usabilidade O micro-ondas BMT45 tem capacidade de 30 litros e acabamento sem frestas ou rebarbas no exterior e interior do aparelho. O painel de controle, assim como os s&iacute;mbolos que aparecem no display, parece complexo &agrave; primeira vista, mas s&atilde;o de f&aacute;cil entendimento e navega&ccedil;&atilde;o. O painel touch reconhece rapidamente o toque do dedo do usu&aacute;rio. Entre as fun&ccedil;&otilde;es, podemos destacar a de adiar preparo, que permite que voc&ecirc; deixe o prato preparado para ser feito dentro do forno de micro-ondas e programe o hor&aacute;rio que deseja que esteja pronto. Imagine deixar, por exemplo, os ingredientes de preparo de arroz numa tigela pr&oacute;pria para micro-ondas e programar no menu Smart Food o arroz e ainda o hor&aacute;rio que voc&ecirc; chega do trabalho para que ele esteja cozido. &Eacute; muita praticidade! Outro destaque &eacute; a Tecla Meu Jeito, que pode deixar as receitas preferidas gravadas na mem&oacute;ria do forno, dispensando que voc&ecirc; tenha que fazer a programa&ccedil;&atilde;o de tempo de preparo e pot&ecirc;ncia toda vez que precisar. &nbsp; Caracter&iacute;sticas t&eacute;cnicas e desempenho Como j&aacute; informado, o BMT45 tem capacidade de 30 litros e trabalha, na pot&ecirc;ncia m&aacute;xima, com 820 W. Operando na frequ&ecirc;ncia de rede de 60 Hz, pesquisamos sua efici&ecirc;ncia no aquecimento de um copo de &aacute;gua e o resultado foi muito bom, chegando &agrave; ebuli&ccedil;&atilde;o em 1 minuto. Um detalhe que incomodou um pouco nesse micro-ondas, enquanto em opera&ccedil;&atilde;o, &eacute; seu ru&iacute;do, um pouco mais alto do que esperamos desse produto. J&aacute; para limpar o equipamento, a tarefa n&atilde;o &eacute; desgastante. Por n&atilde;o apresentar frestas e nem rebarbas, a limpeza foi f&aacute;cil e r&aacute;pida, apenas com um pano &uacute;mido, tanto interna quanto externamente.|O BMT é bonito, moderno e bastante funcional. Tem mais funções de preparo automático de alimentos do que a maioria dos fornos de micro-ondas e ainda pode guardar na memória as suas receitas preferidas. Entretanto, em alguns tipos de alimentos, que compramos próprios para micro-ondas, o desempenho poderia ser melhor. Mesmo assim, apresenta uma boa relação custo-benefício.|369|1'),
(15, 1, 1, 'fogao|Ativado|Nenhum|Fogão 4 Bocas Brastemp Clean Branco Bivolt|A melhor Forma de preparar diversas refei&ccedil;&otilde;es Suas Grades s&atilde;o Individuais e acomodam melhor as panelas, proporcionando uma utiliza&ccedil;&atilde;o mais segura. Todos os Queimadores s&atilde;o de Alum&iacute;nio com a tampa de A&ccedil;o Esmaltado e Selados, sendo 1 Queimador R&aacute;pido e 3 semi-r&aacute;pidos. O Forno &eacute; de f&aacute;cil utiliza&ccedil;&atilde;o e sua temperatura de 180&ordm;C - 280 / 290&ordm;C &eacute; ideal para o preparo de diversas receitas. N&atilde;o precisa abrir o forno durante o preparo o Fog&atilde;o Brastemp possui Luz no Interior e a Porta com Vidro Duplo, tudo para garantir a melhor utiliza&ccedil;&atilde;o. E para o uso seguro ele possui V&aacute;lvula de seguran&ccedil;a que corta automaticamente o fornecimento de G&aacute;s caso a chama apague! Tanto o Forno quanto os Queimadores tem acendimento autom&aacute;tico! &nbsp; Acess&oacute;rios que fazem toda diferen&ccedil;a! A Brastemp traz em seu Fog&atilde;o 4 Bocas Clean diversos acess&oacute;rios para tornar o uso Eficiente! E nada mais eficiente do que um produto de f&aacute;cil limpeza! Seus Bot&otilde;es s&atilde;o Remov&iacute;veis e para limpar basta puxar. Os P&eacute;s Regul&aacute;veis garantem uma boa Altura e maior comodidade na limpeza do piso. &nbsp; Acess&oacute;rios que fazem toda diferen&ccedil;a! A Brastemp traz em seu Fog&atilde;o 4 Bocas Clean diversos acess&oacute;rios para tornar o uso Eficiente! E nada mais eficiente do que um produto de f&aacute;cil limpeza! Seus Bot&otilde;es s&atilde;o Remov&iacute;veis e para limpar basta puxar. Os P&eacute;s Regul&aacute;veis garantem uma boa Altura e maior comodidade na limpeza do piso. Garantindo a Seguran&ccedil;a de todos A cozinha &eacute; um ambiente da casa onde estamos expostos a diversos tipos de acidentes. Para garantir um uso tranquilo o Fog&atilde;o Brastemp fornece a seguran&ccedil;aque merece. Seus Puxadores s&atilde;o feitos em A&ccedil;o com isolamento t&eacute;rmico, evitando assim queimaduras ao manusear o fog&atilde;o, al&eacute;m dos puxadores a parte traseira do fog&atilde;o tamb&eacute;m possui prote&ccedil;&atilde;o t&eacute;rmica. Tenha o espa&ccedil;o adequado para usar as 4 bocas do Fog&atilde;o ao mesmo tempo, suas Grades s&atilde;o Individuais e acomodam melhor as panelas, proporcionando uma utiliza&ccedil;&atilde;o mais segura. Todos os Queimadores s&atilde;o de Alum&iacute;nio com a tampa de A&ccedil;o Esmaltado e Selados, sendo 1 Queimador R&aacute;pido e 3 semi-r&aacute;pidos. O Forno &eacute; de f&aacute;cil utiliza&ccedil;&atilde;o e sua temperatura de 180&ordm;C - 280 / 290&ordm;C &eacute; ideal para o preparo de diversas receitas. E para que voc&ecirc; n&atilde;o precise abrir o forno durante o preparo o Fog&atilde;o Brastemp possui Luz no Interior e a Porta com Vidro Duplo, tudo para garantir a melhor utiliza&ccedil;&atilde;o. E para o uso seguro ele possui V&aacute;lvula de seguran&ccedil;a que corta automaticamente o fornecimento de G&aacute;s caso a chama apague! Tanto o Forno quanto os Queimadores tem acendimento autom&aacute;tico!|Facilidade que s&oacute; a Brastemp pode oferecer Preparar diversas refei&ccedil;&otilde;es de uma forma simples e extremamente pr&aacute;tica! O Fog&atilde;o Brastemp 4 bocas Clean foi desenvolvido para tornar a hora de cozinhar mais f&aacute;cil. Com um design elegante o fog&atilde;o &eacute; feito em a&ccedil;o o que al&eacute;m de garantir um belo produto torna a limpeza f&aacute;cil.|680|1'),
(19, 4, 1, 'batedeira|Ativado|Nenhum|Arno Delice|A Arno Delice oferece 5 n&iacute;veis de velocidade com fun&ccedil;&atilde;o pulsar, al&eacute;m de ter um bom desempenho e versatilidade na hora de preparar uma receita. O motor &eacute; potente, ela &eacute; econ&ocirc;mica e possui um design simples. &nbsp; Funcionalidades O design &eacute; simples, vers&aacute;til e com formas arredondadas. &Eacute; f&aacute;cil de usar, possui 5 n&iacute;veis de velocidades e fun&ccedil;&atilde;o pulsar que ajuda no processo de preparo da sua receita. A Delice pode ser usada tanto como uma batedeira port&aacute;til ou como montada na base. Sua tigela tem capacidade total de 3,3 litros para preparos de grande capacidade e &eacute; fixada na base por meio de trava girat&oacute;ria, que d&aacute; mais firmeza. Possui bot&atilde;o de movimenta&ccedil;&atilde;o (subir e descer) da parte superior (motor), para travar/destravar a batedeira. Os batedores s&atilde;o f&aacute;ceis de lavar e armazenar. &nbsp; Caracter&iacute;sticas T&eacute;cnicas Ela s&oacute; pesa 1,66 quilos e tem as seguintes dimens&otilde;es: 300 mm de largura, 305 mm de altura e 215 mm de profundidade. O aparelho que tem motor potente oferece bom desempenho e boa qualidade. O material &eacute; de pl&aacute;stico, mesmo assim &eacute; ultra resistente. A sua pot&ecirc;ncia &eacute; de 300 W, por isso &eacute; poss&iacute;vel preparar receitas mais dif&iacute;ceis. As informa&ccedil;&otilde;es relacionadas &agrave; seguran&ccedil;a n&atilde;o foram fornecidas pelo fabricante. A batedeira &eacute; desmont&aacute;vel e ainda conta com o bot&atilde;o "EJECT" (para retirada dos batedores). O produto n&atilde;o &eacute; bivolt, ou seja, &eacute; importante atentar para a voltagem no momento da compra, os tipos compat&iacute;veis s&atilde;o: 127V e 220V. Seu consumo de energia em m&eacute;dia &eacute; de 0,24 kW/ h /m&ecirc;s.&nbsp; &nbsp;|A batedeira Arno Delice possui um design simples e vers&aacute;til, 5 n&iacute;veis de velocidade que ajuda no preparo e no melhor resultado de nossas receitas. Depois que voc&ecirc; comprar da uma passa aqui em casa, que agente vai fazer um bolo usando nosso nova batedeira|96.59|1');

