(1, '404 Not Found 1', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title">\r\n<h1>Wow, alguma coisa esta errada...</h1>\r\n</div>\r\n<dl><dt>N&atilde;o encontrei a p&aacute;gina que voc&ecirc; est&aacute; pedindo!</dt><dd>\r\n<ul class="disc">\r\n<li>Talvez voc&ecirc; tenha digitado errado, da uma conferida.</li>\r\n<li>Se voc&ecirc; clicou em algum link, esse link est&aacute; desatualizado.</li>\r\n</ul>\r\n</dd></dl><dl><dt>O que voc&ecirc; pode fazer?</dt><dd>N&atilde;o se preocupe, eu vou ti ajudar, tente fazer uma dessas coisas:</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1); return false;" href="#">Voltar</a> para p&aacute;gina que voc&ecirc; estava.</li>\r\n<li>Use o campo de pesquisa que esta ali em cima, para procurar o presente que voc&ecirc; quer</li>\r\n<li>Voc&ecirc; pode tamb&eacute;m ir direto para a p&aacute;gina inicial do site, s&oacute; clicar <a href="{{store url=""}}">aqui</a></li>\r\n</ul>\r\n</dd></dl>', '2013-09-26 10:15:10', '2013-09-27 17:52:19', 1, 0, NULL, 'default/hellowired', NULL, NULL, NULL, NULL),
(2, 'Página Inicial', 'one_column', NULL, NULL, 'home', NULL, '<div class="wired-home">\r\n<div class="promo">{{block type="cms/block" block_id="helloslide"}}\r\n<div class="promo-right"><a href="#"><img src="{{skin url=''images/media/promo2.jpg''}}" alt="Promotion 2" /></a> <a href="#"><img class="last" src="{{skin url=''images/media/promo3.jpg''}}" alt="Promotion 3" /></a></div>\r\n</div>\r\n<div class="subpromo">\r\n<div class="offers"><a href="#"><img src="{{skin url=''images/media/promo6.jpg''}}" alt="Promotion 2" /></a><a href="#"><img src="{{skin url=''images/media/promo7.jpg''}}" alt="Promotion 2" /></a></div>\r\n<div class="brands"><a href="#"><img src="{{skin url=''images/media/promo5.jpg''}}" alt="Promotion 2" /></a></div>\r\n</div>\r\n<div class="promo-bottom"><a href="#"><img src="{{media url="wysiwyg/banners/barra.png"}}" alt="" /></a></div>\r\n<div class="featured-social">{{block type="catalog/product_list" category_id="12" template="catalog/product/featured.phtml"}}\r\n<div class="subscribe"><strong>Fique Ligado!</strong>\r\n<p>Receba informa&ccedil;&otilde;es e novidades sobre o casamento, inscreva-se!</p>\r\n{{block type="newsletter/subscribe" template="newsletter/subscribe-home.phtml"}}</div>\r\n</div>\r\n</div>', '2013-09-26 10:15:10', '2013-10-04 23:13:18', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', 'default/hellowired', NULL, NULL, NULL, NULL),
